css:
@-moz-document regexp('https://docs\.python\.org/3(?:\.[^/]+)?/.*') { 
  body, .document, .body,
  .body h1, .body h2, .body h3, .body h4, .body h5, .body h6,
  .related, .footnote td, .note,
  .sphinxsidebar {
      background: #222 !important;
      color: #aaa !important;
  }

  .sphinxsidebar a,
  .related a,
  :not(a) > .xref {
      color: #aaa !important;
  }

  :not(a) > .literal {
      background-color: #ddd;
      color: #222;
  }

  .highlight > pre {
      background: #ccddaa;
  }
}
